import React from 'react';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";  
const Bootstrap = () => {
    return(
        <>
   <container>  
    <row>  
     <col class="bg-secondary p-2" md={6}>2 of 3 (wider)</col>  
     <col class="bg-primary p-2">1 of 3</col>  
     <col class="bg-danger p-2">3 of 3</col>  
    </row>  
    <row>  
     <col className="bg-success p-2">1 of 3</col>  
     <col className="bg-warning p-2" md={5}>2 of 3 (wider)</col>  
     <col className="bg-info p-2">3 of 3</col>  
    </row>  
   </container>  




            
        </>
    );
};

export default Bootstrap;
